import Login from './components/Login'
import {Switch, Route} from 'react-router-dom'

function App() {
  return (
    <>
    <Switch>
      <Route exact path="/" component={Login}/>
      <Route exact path="/" component={Login}/>
    </Switch>
    </>
  );
}

export default App;
